svg.script:


var selectedLine = -1;
function doMouseOver(evt) {
    for (i = 0;  i <= 24;  i++) {
         zero = "zero" + i.toString();
         one = "one" + i.toString();
         two = "two" + i.toString();

         if (i == selectedLine) {
             document.getElementById(zero).setAttribute("style", "color:#000000;fill:none;stroke:#000000;stroke-width:2;stroke-linecap:butt;stroke-linejoin:miter;stroke-miterlimit:4;stroke-opacity:1;stroke-dasharray:none;stroke-dashoffset:0;marker:none;marker-end:url(#Arrow1Mend);visibility:visible;display:inline;overflow:visible;enable-background:accumulate");
             document.getElementById(one).setAttribute("style", "color:#000000;fill:none;stroke:#000000;stroke-width:2;stroke-linecap:butt;stroke-linejoin:bevel;stroke-miterlimit:4;stroke-opacity:1;stroke-dasharray:none;stroke-dashoffset:0;marker:none;marker-start:url(#Arrow1Mstart);visibility:visible;display:inline;overflow:visible;enable-background:accumulate");
             document.getElementById(two).setAttribute("style", "color:#000000;fill:none;stroke:#000000;stroke-width:2;stroke-linecap:butt;stroke-linejoin:bevel;stroke-miterlimit:4;stroke-opacity:1;stroke-dasharray:none;stroke-dashoffset:0;marker:none;marker-end:url(#Arrow1Mend);visibility:visible;display:inline;overflow:visible;enable-background:accumulate");
         }
         else {
             document.getElementById(zero).setAttribute("style", "color:#000000;fill:none;stroke:#000000;stroke-width:2;stroke-linecap:butt;stroke-linejoin:miter;stroke-miterlimit:4;stroke-opacity:1;stroke-dasharray:none;stroke-dashoffset:0;marker:none;marker-end:url(#Arrow1Mend);visibility:hidden;display:inline;overflow:visible;enable-background:accumulate");
             document.getElementById(one).setAttribute("style", "color:#000000;fill:none;stroke:#999999;stroke-width:2;stroke-linecap:butt;stroke-linejoin:bevel;stroke-miterlimit:4;stroke-opacity:1;stroke-dasharray:none;stroke-dashoffset:0;marker:none;marker-start:url(#Arrow1MstartGrey);visibility:visible;display:inline;overflow:visible;enable-background:accumulate");
             document.getElementById(two).setAttribute("style", "color:#000000;fill:none;stroke:#999999;stroke-width:2;stroke-linecap:butt;stroke-linejoin:bevel;stroke-miterlimit:4;stroke-opacity:1;stroke-dasharray:none;stroke-dashoffset:0;marker:none;marker-end:url(#Arrow1MendGrey);visibility:visible;display:inline;overflow:visible;enable-background:accumulate");
         }
    }
}
